import './App.css';
import Home from './Conatiner/Home/Home';
import {
  Switch,
  Route,
  Link
} from "react-router-dom";

function App() {
  return (
    <div>
      <div className="App">
        <Switch>
          <Route path="/" component={Home} />
        </Switch>
    </div>
    </div>
  );
}

export default App;
